import React from 'react'
import ReactDom from 'react-dom';
import fetchJsonp from 'fetch-jsonp'



class App extends React.Component {




    render() {
        return (
            <div>
                <input type="button" value="读静态文件" onClick={this.getJson}/>
                <input type="button" value="读jsonp文件"
                       onClick={this.jsonp}/>
                       <input type="button" value="读接口地址栏传参" onClick={this.getMock}/>
                       <input type="button" value="非地址栏传参" onClick={this.postMock}/>
            </div>
        )
    }
    getMock = () => {
        fetch(
            `/mock/home?_page=2&_limit=2`
        ).then(
            res => res.json()
        ).then(
            data => console.log(data)
        )
    };
    postMock = () => {

        let params = new URLSearchParams();
        params.append("username", "alex");
        params.append("password", "alex123");


        let headers = new Headers();
        headers.append("Content-type", "application/x-www-form-urlencoded");
    };


    getJson = () =>{
        fetch(
            `./data/shuju.json`
        ).then(res=>res.json().then(data => console.log(data)))
    }
    jsonp = ()=> {
        fetchJsonp(
            `https://www.baidu.com/sugrec?pre=1&p=3&ie=utf-8&json=1&prod=pc&from=pc_web&sugsid=1448,21126,29238,28518,29098,28835,29221,22160&wd=呵呵哒&req=2&bs=%E5%AD%A6%E4%BF%A1%E7%BD%91&pbs=%E5%AD%A6%E4%BF%A1%E7%BD%91&csor=3&pwd=xx&cb=show`,

            {jsonpCallback: 'cb',}
        ).then(
            res => res.json()
        ).then(
            data => console.log(data)
        )
    }

}



ReactDom.render(
    <App/>,
    document.querySelector("#root"),
    ()=>console.log('render is over')
)
